# 1 "Lexer.fsl"
 
module internal EmberLib.Glow.Formula.Lexer

open System
open FSharp.Text.Lexing
open Parser
open System.Collections.Generic
open System.Globalization
open System.Text
open FSharp.Text.Parsing.ParseHelpers

let lexeme (lexbuf : LexBuffer<char>) = LexBuffer<_>.LexemeString lexbuf

let dbg value =
    //printf "%A " value
    value

let lookup =
    let keywordMap =
        let temp = new Dictionary<_,_>(StringComparer.CurrentCultureIgnoreCase)
        temp.Add("sin", SIN)
        temp.Add("cos", COS)
        temp.Add("tan", TAN)
        temp.Add("sinh", SINH)
        temp.Add("cosh", COSH)
        temp.Add("tanh", TANH)
        temp.Add("asin", ASIN)
        temp.Add("acos", ACOS)
        temp.Add("atan", ATAN)
        temp.Add("sqrt", SQRT)
        temp.Add("pi", PI)
        temp.Add("e", E)
        temp.Add("log", LOG)
        temp.Add("round", ROUND)
        temp.Add("ceil", CEIL)
        temp.Add("int", INT)
        temp.Add("float", FLOAT)
        temp.Add("exp", EXP)
        temp.Add("abs", ABS)
        temp.Add("sgn", SGN)
        temp
    fun word ->
        let (result, value) = keywordMap.TryGetValue(word)
        if result = true then
            value
        else
            failwithf "Unknown keyword: %s" word

